import './App.css';
import Restaurant from './components/restaurant';
import Navigate from './components/navigate';
import { BrowserRouter,Route } from 'react-router-dom';

function App() {
  return (
    <div>
      <Navigate />

      <BrowserRouter>
        <Switch>
          <Route path="/res">
            <Restaurant/>
          </Route>
        </Switch>
      </BrowserRouter>

    </div>

  );
}

export default App;
